import { NavLink } from "react-router-dom";
import React from "react";

export default function NavBar() {
  return (
    <div>
      <nav>
        <NavLink to="/">Product</NavLink> {" || "}
        <NavLink to="cart">Cart</NavLink> {" || "}
        <NavLink to="wishlist">Wishlist</NavLink>
      </nav>
    </div>
  );
}
